import * as React from 'react';
import PropTypes from 'prop-types';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import IconButton from '@mui/material/IconButton';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

import styled, { ThemeProvider } from "styled-components";
import ReactDOM from "react-dom";
import Avatar from "@material-ui/core/Avatar";
import AvatarGroup from "@material-ui/lab/AvatarGroup";
import { StylesProvider, useTheme } from "@material-ui/core/styles";


const drawerWidth = 240;
const navItems = ['Home', 'About', 'Contact'];

function NavBar(props) {
    const { window } = props;
    const [mobileOpen, setMobileOpen] = React.useState(false);

    const handleDrawerToggle = () => {
        setMobileOpen(!mobileOpen);
    };

    const drawer = (
        <Box onClick={handleDrawerToggle} sx={{ textAlign: 'center' }}>
            <Divider />
            <List>
                {navItems.map((item) => (
                    <ListItem key={item} disablePadding>
                        <ListItemButton sx={{ textAlign: 'center' }}>
                            <ListItemText primary={item} />
                        </ListItemButton>
                    </ListItem>
                ))}
            </List>
        </Box>
    );

    const Content = styled.div`
  margin: auto;
  max-width: 500px;
`;

    const GreenAvatar = styled(Avatar)`
  background-color: green;
`;

    const BlueAvatar = styled(Avatar)`
  background-color: blue;
`;

    const OrangeAvatar = styled(Avatar)`
  background-color: orange;
`;

    const BorderedAvatar = styled(Avatar)`
  border: 3px solid lightseagreen;
`;

    const AvatarContainer = styled.div`
  display: flex;
  margin-bottom: 14px;
  & > * {
    margin: 4px;
  }
`;

    const SizedAvatar = styled(Avatar)`
  ${({ size, theme }) => `
    width: ${theme.spacing(size)}px; 
    height: ${theme.spacing(size)}px; 
  `};
`;

    function ImageAvatars() {
        return (
            <AvatarContainer>
                <Avatar
                    alt="Jack Sparrow"
                    src="https://images.pexels.com/photos/4016173/pexels-photo-4016173.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                />
                <Avatar
                    alt="Mike Wazowski"
                    src="https://images.pexels.com/photos/6386956/pexels-photo-6386956.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                />
                <Avatar
                    alt="Evelyn Carnahan"
                    src="https://images.pexels.com/photos/1722198/pexels-photo-1722198.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                />
            </AvatarContainer>
        );
    }

    function LetterAvatars() {
        return (
            <AvatarContainer>
                <Avatar>Da</Avatar>
                <Avatar>W</Avatar>
                <Avatar>G</Avatar>
            </AvatarContainer>
        );
    }

    const AvatarLabel = styled.div`
  display: flex;
  align-items: center;
`;

    function AvatarWithText() {
        return (
            <AvatarContainer>
                <AvatarLabel>
                    <Avatar
                        style={{ marginRight: "14px" }}
                        alt="Jack Sparrow"
                        src="https://images.pexels.com/photos/6386956/pexels-photo-6386956.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                    />
                    <Typography variant="body2"> Jack Sparrow</Typography>
                </AvatarLabel>
            </AvatarContainer>
        );
    }

    function ColoredAvatars() {
        return (
            <AvatarContainer>
                <GreenAvatar>G</GreenAvatar>
                <BlueAvatar>B</BlueAvatar>
                <OrangeAvatar>O</OrangeAvatar>
            </AvatarContainer>
        );
    }

    function BorderedAvatars() {
        return (
            <AvatarContainer>
                <BorderedAvatar
                    alt="Jack Sparrow"
                    src="https://images.pexels.com/photos/4016173/pexels-photo-4016173.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                />
                <BorderedAvatar
                    alt="Mike Wazowski"
                    src="https://images.pexels.com/photos/6386956/pexels-photo-6386956.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                />
                <BorderedAvatar
                    alt="Evelyn Carnahan"
                    src="https://images.pexels.com/photos/1722198/pexels-photo-1722198.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                />
            </AvatarContainer>
        );
    }

    function AvatarButton() {
        return (
            <IconButton onClick={() => console.log("hi")}>
                <Avatar>C</Avatar>
            </IconButton>
        );
    }

    function FallbackAvatars() {
        return (
            <AvatarContainer>
                <Typography>
                    If broken image, uses children, then first letter of alt, then generic
                    avatar image
                </Typography>
                <Avatar alt="Jack Sparrow" src="/broken-image.jpg">
                    B
                </Avatar>
                <Avatar alt="Jack Sparrow" src="/broken-image.jpg" />
                <Avatar src="/broken-image.jpg" />
            </AvatarContainer>
        );
    }

    function AvatarGroupExample() {
        // You must install @material-ui/lab to use AvatarGroup
        return (
            <AvatarContainer>
                <AvatarGroup max={4}>
                    <Avatar
                        alt="John Smith"
                        src="https://images.pexels.com/photos/4016173/pexels-photo-4016173.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                    />
                    <Avatar
                        alt="Jack Sparrow"
                        src="https://images.pexels.com/photos/1722198/pexels-photo-1722198.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                    />
                    <Avatar alt="D" src="/example.jpg" />
                    <Avatar alt="F" src="/example.jpg" />
                    <Avatar alt="F" src="/example.jpg" />
                </AvatarGroup>
            </AvatarContainer>
        );
    }

    function SizedAvatars() {
        return (
            <AvatarContainer>
                <SizedAvatar
                    size={4}
                    alt="Jack Sparrow"
                    src="https://images.pexels.com/photos/6386956/pexels-photo-6386956.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                >
                    G
                </SizedAvatar>
                <SizedAvatar
                    size={6}
                    alt="Mike Wazowski"
                    src="https://images.pexels.com/photos/1722198/pexels-photo-1722198.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                >
                    B
                </SizedAvatar>
                <SizedAvatar
                    size={16}
                    alt="Evelyn Carnahan"
                    src="https://images.pexels.com/photos/4016173/pexels-photo-4016173.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
                >
                    O
                </SizedAvatar>
            </AvatarContainer>
        );
    }

    const container = window !== undefined ? () => window().document.body : undefined;

    return (
        <Box sx={{ display: 'flex' }}>
            <AppBar component="nav" elevation={0} style={{ background: 'NONE' }}>
                <Toolbar>
                    <IconButton
                        color="inherit"
                        aria-label="open drawer"
                        edge="start"
                        onClick={handleDrawerToggle}
                        sx={{ mr: 2, display: { sm: 'none' } }}
                    >
                        <MenuIcon />
                    </IconButton>
                    <Typography
                        variant="h6"
                        component="div"
                        sx={{ flexGrow: 1, display: { xs: 'none', sm: 'block' } }}
                    >
                    </Typography>
                    <Box sx={{ display: { xs: 'none', sm: 'block' } }}>
                        {navItems.map((item) => (
                            <Button key={item} sx={{ padding: '20px', fontSize: '20px', color: '#000000' }}>
                                {item}
                            </Button>
                        ))}
                    </Box>
                </Toolbar>
            </AppBar>
            <Box component="nav">
                <Drawer
                    container={container}
                    variant="temporary"
                    open={mobileOpen}
                    onClose={handleDrawerToggle}
                    ModalProps={{
                        keepMounted: true, // Better open performance on mobile.
                    }}
                    sx={{
                        display: { xs: 'block', sm: 'none' },
                        '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
                    }}
                >
                    {drawer}
                </Drawer>
            </Box>

        </Box>
    );
}

